import React from "react";
import { Row, Col } from "react-bootstrap";

const PortfolioDescription = (props) => (
  <Col className="p-0">

    <h4>{props.title}</h4>
    <ul className="no-bullet">{props.children}</ul>
  </Col>
);

export default PortfolioDescription;
